import React, {useState} from 'react';

function App () {
	const [count, setCount] = useState(23); // array [state mani, state ozgertetin func]

	function add() {
		setCount(count + 1);
	}

	function minus() {
		setCount(count - 1);
	}

	return (
		<div>
			<h1>{count}</h1>
			<button onClick={add}>Add</button>
			<button onClick={minus}>Minus</button>
		</div>
	);
}


export default App;
